message:
Request: {"query":"
        query app_list_by_developer($page: Int = 1, $size:Int = 10) {
          app_list_by_developer(page: $page, size: $size) {
            total_items
            data {
              id
              status
              updated_at
              identifier
              registered_name
              image_url
              metadata {
                kind
                badge
              }
              released_version{
                id
                name
                image_url
                updated_at
              }
            }
          }
        }
      ","variables":{"page":1,"size":50}}
